import './App.css';
import NavBar from './NavBar.js';
import HomePage from './HomePage.js';
import FooterPart from './footerPart.js';
import ComputerPage from './ComputerPage.jsx';
import CivilPage from './CivilPage.jsx';
import EventsPage from './EventsPage.jsx';
import {
  BrowserRouter as Router,
  Switch,
  Route
} from 'react-router-dom';

function App() {
  return (
    <>
    <Router>  
    <NavBar/>
      <Switch>
        <Route path="/HomePage" component={HomePage}/>
        <Route path="/ComputerPage" component={ComputerPage}/>
        <Route path="/CivilPage" component={CivilPage}/>
        <Route path="/EventsPage" component={EventsPage}/>
      </Switch>
      <FooterPart/>
    </Router>
    </>
  );
}

export default App;
